// ==UserScript==
// @name        SSL-DL-btn & Cmnt-pop by firefantast
// @description Adds thickbox comment popup to browse page comment links. Also adds a direct download button to each torrent.
// @include     https://feedthe.net/browse.php*
// ==/UserScript==

/* Script version: 2010-12-28 */
/* 2010-03-30 Changed to SSL-link. */
/* 2010-12-28 Fixed the broken loop with a new check. A <small> tag had been added to the header. */

/* Hi there! Welcome to the code, I've added some comments for you! Have fun! */

(function() {
		//base64 decoder: http://www.opinionatedgeek.com/dotnet/tools/Base64Decode/Default.aspx
		
		//download icon (floppy)
		var iconDL = "data:image/gif;base64,R0lGODlhEAAQALMAAAAAAP////X19dDQ0J2dnZSUlHBwcGJiYj8/P////wAAAAAAAAAAAAAAAAAAAAAAACH5BAEAAAkALAAAAAAQABAAAARUMMlJqwQ4a0wBGcAgGoYAGMDkgUFLmsaRJivQBi9wyNcXikAdj+bbYHazVaFAIu2QPYTxODz9gMEqanATeEHSy7b7BYRp45ZXAE7KsFhzcmq02CkRADs%3D";
		
		//comment icon (little bubble)
		var iconCM = "data:image/gif;base64,R0lGODlhDgAOAJECAAAAAP///////wAAACH5BAEAAAIALAAAAAAOAA4AAAIjlI8Iy+0Bo4Rr2lCvzJoCioWf10Vcd2oOYzKJ8QFv4s7KchQAOw%3D%3D";
		//ajax-poster script
		var ajax_post = "data:application/x-javascript;base64,";
		//thickbox library
		var thickbox_js = "data:application/x-javascript;base64,";
		//jquery library
		var thickbox_query = "data:application/x-javascript;base64,";
		//thickbox css
		var thickbox_css = "data:text/css;base64,";
		
		//insert scripts for comment popup
		var head_node = document.getElementsByTagName('head')[0];
		
		var tbx_css = document.createElement("link");
		tbx_css.setAttribute('rel','stylesheet');
		tbx_css.setAttribute('type','text/css');	
		tbx_css.setAttribute('href',thickbox_css);
		
		var tbx_js = document.createElement("script");
		tbx_js.setAttribute('src',thickbox_js);
		tbx_js.setAttribute('type','text/javascript');	
		
		var tbx_qy = document.createElement("script");
		tbx_qy.setAttribute('src',thickbox_query);
		tbx_qy.setAttribute('type','text/javascript');
		
		var ajx_pst = document.createElement("script");
		ajx_pst.setAttribute('src',ajax_post);
		ajx_pst.setAttribute('type','text/javascript');		
		
		
		head_node.insertBefore(tbx_qy,head_node.firstChild);
		head_node.insertBefore(tbx_js,head_node.firstChild);
		head_node.insertBefore(ajx_pst,head_node.firstChild);
		head_node.insertBefore(tbx_css,head_node.firstChild);
			
		//find comment headline
		var cm_column = document.getElementsByClassName('colhead')[8];
		
		//change comment header (insert icon)
		cm_column.innerHTML = "";
		var cm_img = document.createElement("img");
		cm_img.src = iconCM;
		cm_img.setAttribute('border','0');
		cm_column.appendChild(cm_img);
		
		//find file headline (to insert DL-header)
		var file_column = document.getElementsByClassName('colhead')[5];
		
		//add download header (before file headline)
		var col_td = document.createElement("td");
		col_td.setAttribute('align','center');
		col_td.setAttribute('class','colhead');
		var col_txt = document.createTextNode("DL");
		col_td.appendChild(col_txt);
		file_column.parentNode.insertBefore(col_td,file_column)
		
		
		//find torrents to loop
		var torrent_nodes = document.getElementsByTagName('small');
		var loops = torrent_nodes.length;
		//alert(loops); //debug
		
		//check where the first torrent is in the nodelist
		var j=0;
		while (torrent_nodes[j].firstChild.nodeName != "#text")
		{
			j++;
		} 
		
		//looping torrents.
		for (i=j; i<loops; i++)
		{
			/*==GENERAL STUFF==*/
			//find torrent link
			var small_node = torrent_nodes[i];
			var torrent_td_node = small_node.parentNode;
		    	var torrent_link_node = torrent_td_node.firstChild
			
			//extract torrent id
			var link = torrent_link_node.href;
			var start_indx = link.indexOf("?id=")+4;
			var stop_indx = link.indexOf("&hit");
			var link_id = link.substring(start_indx,stop_indx);
			
			//find comment-node & file-node
			var cm_node = torrent_td_node.parentNode.childNodes[7];
			var file_td_node = torrent_td_node.parentNode.childNodes[5];
			
			//get rls-name for comment-popup
			var rls_name = torrent_link_node.firstChild.firstChild.getAttribute('title');
			rls_name = rls_name.replace(/ /g,"_")
			
			/*==COMMENT POPUP THINGY==*/
			//remove style on file-link
			var removed_node = file_td_node.removeChild(file_td_node.firstChild); //remove <b> node
			file_td_node.appendChild(removed_node.firstChild); //put back <a node
			file_td_node.firstChild.setAttribute('style','text-decoration: none'); //remove underline
			
			//create release text for popup
			var rls_txt = document.createTextNode(rls_name);
			var cm_headline = document.createElement("p");
			cm_headline.setAttribute('style','font-weight: bold');
			cm_headline.appendChild(rls_txt);
			
			//create comment content div
			var cm_div = document.createElement("div");
			cm_div.setAttribute('id','cm'+link_id);
			cm_div.setAttribute('style','display:none');
			
			//create form fields			
			var cm_text = document.createElement("textarea");
			cm_text.setAttribute('id','cmt'+link_id);
			cm_text.setAttribute('name','cmt');
			cm_text.setAttribute('rows','4');
			cm_text.setAttribute('cols','50');
			
			var cm_btn = document.createElement("input");
			cm_btn.setAttribute('id','btn'+link_id);
			cm_btn.setAttribute('class','button');
			cm_btn.setAttribute('value','Submit');	
			cm_btn.setAttribute('type','button');
			cm_btn.setAttribute('onclick','postcom("'+link_id+'")');
			
			var cm_br = document.createElement("br");
			
			//put together form content in the div
			cm_div.appendChild(cm_headline);
			cm_div.appendChild(cm_text);
			cm_div.appendChild(cm_br);
			cm_div.appendChild(cm_btn);
			
			//inserting hidden popup content
			cm_node.parentNode.insertBefore(cm_div,cm_node);
			
			//change some attribs on the comment cell
			cm_node.setAttribute('align','center');
			cm_node.setAttribute('id','td'+link_id);
			
			//is the first child a <b> node? (do we have come comments and a link?)
			var cm_node_child = cm_node.firstChild.nodeName;
			if (cm_node_child == "B") //if there is a link already
			{
				var cm_link = cm_node.firstChild.firstChild;
			}
			else //0 comments and no link
			{
				cm_node.innerHTML = ""; //removing the zero
				var cm_bold = document.createElement("b");
				var cm_link = document.createElement("a");
				cm_link.innerHTML = "0";
				cm_bold.appendChild(cm_link);
				cm_node.appendChild(cm_bold);	
			}
			//super mega elite thickbox-link
			cm_link.href = '#TB_inline?hax=1&height=155&width=400&inlineId=cm'+link_id;
			cm_link.title = "Quick comment";
			cm_link.setAttribute('class','thickbox');
			cm_link.setAttribute('id','lnk'+link_id);
			
			
			/*==DIRECT DOWNLOAD BUTTON==*/
			//create download link to SSL-tracker
			var dl_link = "download.php/" + link_id + "/" + rls_name + ".torrent?ssl=1";
			
			//create download picture (floppy)
			var dl_img = document.createElement("img");
			dl_img.src = iconDL;
			dl_img.setAttribute('border','0');
			
			//create new cell
			var dl_td = document.createElement("td");
			dl_td.setAttribute('align','center');
			
			//create new link for floppy
			var link_node = document.createElement("a");
			link_node.href = dl_link;
			link_node.appendChild(dl_img);
			
			//insert download link cell
			dl_td.appendChild(link_node);
			file_td_node.parentNode.insertBefore(dl_td,file_td_node);
			
			/*==END HERE==*/
		} //end for-loop
})();